import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const DebugChat = () => {
  const navigate = useNavigate();
  const [userId, setUserId] = useState('');

  const handleTestChat = async () => {
    if (!userId) {
      alert('Введите ID пользователя');
      return;
    }

    console.log('🚀 Тестируем создание чата с пользователем:', userId);
    
    try {
      // Получаем токен
      const token = localStorage.getItem('accessToken') || sessionStorage.getItem('accessToken');
      if (!token) {
        alert('Нет токена авторизации');
        return;
      }

      // Проверяем существующие чаты
      console.log('🔍 Проверяем существующие чаты...');
      const chatsResponse = await fetch('http://localhost:8000/api/users/chats/', {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });
      
      console.log('📡 Ответ от сервера чатов:', chatsResponse.status);
      
      if (chatsResponse.ok) {
        const chatsData = await chatsResponse.json();
        console.log('📋 Данные чатов:', chatsData);
        
        if (chatsData.success) {
          // Ищем существующий чат с этим пользователем
          const existingChat = chatsData.chats.find(chat => 
            chat.other_participant && chat.other_participant.id === parseInt(userId)
          );
          
          if (existingChat) {
            console.log('✅ Найден существующий чат:', existingChat.id);
            navigate(`/chat/${existingChat.id}`);
            return;
          }
        }
      }
      
      // Если чата нет, создаем новый
      console.log('🆕 Создаем новый чат...');
      const response = await fetch('http://localhost:8000/api/users/chats/create/', {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({ participant_id: parseInt(userId) })
      });
      
      console.log('📡 Ответ от сервера создания чата:', response.status);
      
      if (response.ok) {
        const data = await response.json();
        console.log('📋 Данные созданного чата:', data);
        
        if (data.success) {
          console.log('✅ Чат создан успешно, переходим к чату:', data.chat.id);
          navigate(`/chat/${data.chat.id}`);
        } else {
          console.error('❌ Ошибка создания чата:', data.message);
          alert('Ошибка создания чата: ' + data.message);
        }
      } else {
        console.error('❌ Ошибка HTTP:', response.status);
        const errorData = await response.json();
        console.error('❌ Данные ошибки:', errorData);
        alert('Ошибка создания чата: ' + (errorData.message || 'Неизвестная ошибка'));
      }
    } catch (error) {
      console.error('❌ Ошибка создания чата:', error);
      alert('Ошибка создания чата: ' + error.message);
    }
  };

  return (
    <div style={{ padding: '20px', maxWidth: '600px', margin: '0 auto' }}>
      <h1>Отладка чата</h1>
      
      <div style={{ marginBottom: '20px' }}>
        <label>
          ID пользователя:
          <input 
            type="number" 
            value={userId} 
            onChange={(e) => setUserId(e.target.value)}
            style={{ marginLeft: '10px', padding: '5px' }}
          />
        </label>
      </div>
      
      <button 
        onClick={handleTestChat}
        style={{ 
          padding: '10px 20px', 
          backgroundColor: '#007bff', 
          color: 'white', 
          border: 'none', 
          borderRadius: '5px',
          cursor: 'pointer'
        }}
      >
        Создать чат с пользователем
      </button>
      
      <div style={{ marginTop: '20px' }}>
        <h3>Инструкции:</h3>
        <ol>
          <li>Введите ID пользователя (например, 1, 2, 3)</li>
          <li>Нажмите "Создать чат с пользователем"</li>
          <li>Откройте консоль браузера (F12) для просмотра логов</li>
          <li>Если все работает, вы должны перейти в чат с этим пользователем</li>
        </ol>
      </div>
      
      <div style={{ marginTop: '20px' }}>
        <button 
          onClick={() => navigate('/chats')}
          style={{ 
            padding: '10px 20px', 
            backgroundColor: '#28a745', 
            color: 'white', 
            border: 'none', 
            borderRadius: '5px',
            cursor: 'pointer',
            marginRight: '10px'
          }}
        >
          Перейти к списку чатов
        </button>
        
        <button 
          onClick={() => navigate('/friends')}
          style={{ 
            padding: '10px 20px', 
            backgroundColor: '#6f42c1', 
            color: 'white', 
            border: 'none', 
            borderRadius: '5px',
            cursor: 'pointer'
          }}
        >
          Перейти к друзьям
        </button>
      </div>
    </div>
  );
};

export default DebugChat;
